#ifndef __MARKETID_H__
#include "MarketId.h"
#endif

#include <assert.h>

	
std::ostream&
operator<<( std::ostream& ostr, const MarketId& c )
{
	ostr << c.toString();
	return ostr;
}

std::istream&
operator>>( std::istream& istr, MarketId& c )
{
	std::string str;
	istr >> str;
	c.setMarketId( str );
	return istr;
}

//
//
//


std::string
MarketId::name( void ) const 
{
	return m_fullMicNames[m_fromISO[m_mic]];
}


// this speeds up setMarketId quite a bit
const short MarketId::m_searchPoints[27] = {
    1, 126, 359, 576, 644, 783, 855, 953, 1001, 1158, 1192, 1225, 1294, 1472, 1584, 1622, 1693, 1698, 1747, 1914, 2099, 2147, 2191, 2223, 2844, 2847, 2858, 
};

bool
MarketId::setMarketId( const std::string& str )
{	
    if ((str.size() != 4) && (str.size() != 5 || str[0] != 'A'))
	{
        m_mic = MarketId::XXXX; // NOMARKET
		return false;
	}
  
    int index = str[0] - 'A'; // 'A' = 65;
    
    //assert(index > -1 && index < 26);
    if (index < 0 || index > 25)
    {
        m_mic = MarketId::XXXX;
        return false;
    }
    
	int low   = m_searchPoints[index];
	int high  = m_searchPoints[index + 1]; 
       
	while (low < high) 
	{		
        int mid = low + ((high - low) >> 1);
        const char * const mic = m_micNames[mid];
        
        int i = 1;
        
        for (; i < 4; ++i)
        {
            const char &a = str[i];
            const char &b = mic[i];
            
            if (a < b)
            {
                high = mid; 
                break;
            }
            
            if (a > b)
            {
                low = mid + 1;
                break;
            }
        }
        
        if (i > 3)
        {
            m_mic = m_toISO[mid]; 
			return true;
        }
	}
	
    m_mic = MarketId::XXXX; // NOMARKET
	return false;
} 



